public class CmsDocumentDaoTest extends Doofenshmirtz<CmsDocument> {

  CmsDocument doc;
  CmsDocumentDao target;
  LZWEncoder lzw;

  String docHandle = "7759421009100220*ADMINOA 00006";

  @Override
  @Before
  public void setup() throws Exception {
    super.setup();

    target = new CmsDocumentDao(sessionFactory);
    target.setLzwSupplier(() -> lzw);

    doc = new CmsDocument(docHandle // id/doc_handle
        , (short) 1 // segmentCount
        , 1934L // docLength
        , "ADMINOA " // docAuth
        , "D7401W01" // docServ
        , DomainChef.uncookDateString("2002-10-09") // docDate
        , DomainChef.uncookTimeString("10:42:59") // docTime
        , "Testd000.DOC" // docName
        , "CWSCMP01" // compressionMethod
    );

    lzw = mock(LZWEncoder.class);
    doReturn(Boolean.TRUE).when(lzw).didLibraryLoad();

    // Must write the base64-encoded answer to a **file**.
    // Mockito magic.
    doAnswer(new Answer<Void>() {
      @Override
      public Void answer(InvocationOnMock invocation) {
        try {
          File f = new File((String) invocation.getArguments()[1]);
          FileOutputStream fos = new FileOutputStream(f);
          fos.write(DatatypeConverter.parseBase64Binary(
              ""));
          fos.flush();
          fos.close();
        } catch (Exception e) {
        }

        return null;
      }
    }).when(lzw).fileCopyUncompress(any(String.class), any(String.class));

    doAnswer(new Answer<Void>() {
      @Override
      public Void answer(InvocationOnMock invocation) {
        try {
          File f = new File((String) invocation.getArguments()[1]);
          FileOutputStream fos = new FileOutputStream(f);
          fos.write(DatatypeConverter.parseBase64Binary(
              ""));
          fos.flush();
          fos.close();
        } catch (Exception e) {
        }

        return null;
      }
    }).when(lzw).fileCopyUncompress(any(String.class), any(String.class));

    new TestingRequestExecutionContext("0X5");
    RequestExecutionContext.instance();
  }

  @Test
  public void type() throws Exception {
    assertThat(CmsDocumentDao.class, notNullValue());
  }

  @Test
  public void instantiation() throws Exception {
    assertThat(target, notNullValue());
  }

  @Test
  public void compressPK_Args__CmsDocument__String() throws Exception {
    final String src = PKCompressionTest.class.getResource(PKCompressionTest.ZIP_B64_3).getPath();
    final String base64 = FileCopyUtils.copyToString(new FileReader(new File(src))).trim();
    List<CmsDocumentBlobSegment> actual = target.compressPK(doc, base64);
    assertThat(actual, is(notNullValue()));
  }

  @Test
  public void decompressDoc_Args__CmsDocument() throws Exception {
    final String src = PKCompressionTest.class.getResource(PKCompressionTest.ZIP_B64_3).getPath();
    final String base64 = FileCopyUtils.copyToString(new FileReader(new File(src))).trim();
    final List<CmsDocumentBlobSegment> blobs = target.compressPK(doc, base64);
    doc.setBlobSegments(new HashSet<>(blobs));
    String actual = target.decompressDoc(doc);
    assertThat(actual, is(notNullValue()));
  }

  @Test
  public void compressPK_A$CmsDocument$String() throws Exception {
    final String base64 = getClass().getResource(PKCompressionTest.ZIP_DOC_1).getPath();
    doc.setCompressionMethod("02");
    List<CmsDocumentBlobSegment> actual = target.compressPK(doc, base64);
    assertThat(actual, is(notNullValue()));
  }

  @Test
  public void compressPlain_A$CmsDocument$String() throws Exception {
    final String base64 = getClass().getResource(PKCompressionTest.ZIP_DOC_1).getPath();
    List<CmsDocumentBlobSegment> actual = target.compressPlain(doc, base64);
    List<CmsDocumentBlobSegment> expected = new ArrayList<>();
    expected.add(JsonUtils.from(
        "{\"docHandle\":null,\"segmentSequence\":\"0001\",\"docBlob\":\"++stt+783U0Za9v/aKzz1sw8vj9rxv48zf99FfuX+d/v2q0LAA==\",\"primaryKey\":{\"columns\":[\" \",\"0001\"]}}",
        CmsDocumentBlobSegment.class));
    assertThat(actual, is(notNullValue()));
    // assertThat(actual, is(equalTo(expected)));
  }

  @Test
  public void decompressDoc_A$CmsDocument() throws Exception {
    String actual = target.decompressDoc(doc);
    assertThat(actual, is(notNullValue()));
  }

  @Test
  public void compressDoc_A$CmsDocument$String() throws Exception {
    final String base64 = DatatypeConverter.printBase64Binary(Files
        .readAllBytes(
            new File(getClass().getResource(LZWCompressionTest.GOOD_DOC).getPath()).toPath()));
    doc.setCompressionMethod("01");
    final List<CmsDocumentBlobSegment> actual = target.compressDoc(doc, base64);
    assertThat(actual, is(notNullValue()));
  }

  @Test
  public void decompressPlain_A$CmsDocument() throws Exception {
    String actual = target.decompressPlain(doc);
    assertThat(actual, is(notNullValue()));
  }

  @Test
  public void decompressLZW_A$CmsDocument() throws Exception {
    try {
      String docHandle = "7759421009100220*ADMINOA 00006";
      CmsDocument doc = new CmsDocument(docHandle // id/doc_handle
          , (short) 1 // segmentCount
          , 1934L // docLength
          , "ADMINOA " // docAuth
          , "D7401W01" // docServ
          , DomainChef.uncookDateString("2002-10-09") // docDate
          , DomainChef.uncookTimeString("10:42:59") // docTime
          , "Testd000.DOC" // docName
          , "CWSCMP01" // compressionMethod
      );

      doc.addBlobSegment(
          new CmsDocumentBlobSegment(docHandle, "0001", DatatypeConverter.parseHexBinary(
              "")));

      // Don't call statically. Construct the DAO and test.
      final String base64Doc = target.decompressDoc(doc);

      if (!StringUtils.isBlank(base64Doc)) {
        System.out.println("base64Doc len=" + base64Doc.length());
      }

      final boolean answer =
          ""
              .equals(base64Doc);

      assertTrue("LZW decompression failed", answer);
    } catch (Exception e) {
      e.printStackTrace();
      fail("Exception: " + e.getMessage());
    }
  }

  @Test
  public void blobSegmentsToFile_A$CmsDocument$File() throws Exception {
    final File f = File.createTempFile("tgt", ".lzw");
    f.deleteOnExit();

    try (FileOutputStream fos = new FileOutputStream(f)) {
      fos.write(DatatypeConverter.parseBase64Binary(
          ""));
    } catch (Exception e) {
    }
    target.blobSegmentsToFile(doc, f);
  }

  @Test
  public void compressLZW_A$CmsDocument$String() throws Exception {
    final String base64 = FileCopyUtils
        .copyToString(
            new FileReader(new File(getClass().getResource(PKCompressionTest.ZIP_B64_3).getPath())))
        .trim();
    final List<CmsDocumentBlobSegment> actual = target.compressLZW(doc, base64);
    final List<CmsDocumentBlobSegment> expected = new ArrayList<>();
    assertThat(actual, is(equalTo(expected)));
  }

  @Test(expected = ServiceException.class)
  public void errorDecompressing_A$Exception() throws Exception {
    Exception e = new IllegalStateException("test");
    target.errorDecompressing(e);
  }

  @Test(expected = ServiceException.class)
  public void errorCompressing_A$Exception() throws Exception {
    Exception e = new IllegalStateException("test");
    target.errorCompressing(e);
  }

}
